import { createSlice } from '@reduxjs/toolkit'

export const listSlice = createSlice({
  name: 'list',
  initialState : {},
  reducers: {},
  
})

// Action creators are generated for each case reducer function
export const {} = listSlice.actions

export default listSlice.reducer
